import React from 'react';
import DevImg from '../Assets/developer-boy.png';

class Lead extends React.Component {
    constructor(props){
        super(props);
    }

    render () {
        return (
        <div className="w-100 p-3 py-5 d-flex flex-column flex-sm-row-reverse justify-content-center align-items-sm-center" style={{height: 'fit-content', backgroundColor: '#00000F', color: '#00CD00', fontSize: 30}}>
            <img src={DevImg} alt="young developer image" className="w-100" />
            <div className="w-100 text-sm-start">
                <h2>Hello, Universe!</h2>
                <h1 >I'm Goodness, a <strong style={{opacity: '0.5'}}>Frontend Developer</strong></h1>
                <p style={{color: '#ffffff'}}>I build stunning and business evolving websites.</p>
                <button className="btn btn-primary">Get in Touch</button>
            </div>
         </div>
        );
    }
}

export { Lead }
